import jwt from 'jsonwebtoken';
import User from '../models/User';
import Role from '../models/Role';

export const signup = async (req,res)=>{
    const {username,email,password, roles} = req.body;
    const newUser = new User({
        username,
        email,
        password: await User.encryptPassword(password)
    });

    
    if(roles){
        const foundRoles  = await Role.find({name: {$in: roles}});
        newUser.roles = foundRoles.map(role => role._id);
    }
    else{
        const role = await Role.findOne({name: "user"})
        newUser.roles = [role._id]
    }

    const saveUser = await newUser.save();      
    const token = jwt.sign({id: saveUser._id},"product",{
        expiresIn: 86400
    })
    res.status(200).json({token});


}

export const signin = async (req,res)=>{
    const userFound = await User.findOne({email: req.body.email}).populate("roles");
    if(!userFound) return res.status(400).json({messaje: "User not found"});

    const match = await User.comparePassword(req.body.password,userFound.password);
    if(!match) return res.status(401).json(`null ${match}`);

    const token = jwt.sign({id: userFound._id},"product",{
        expiresIn: 86400
    })    

    res.json({token})
}

